import React from "react";
import { useEffect, useState } from "react";
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";
import Spinner from 'react-bootstrap/Spinner';
import projectData from "./data.js";
const Playlist = () => {
    const [spin , setSpin] = useState(true);
    useEffect(()=>{
        setTimeout(() => {
            setSpin(false);
        }, 1000);
    })

  return (
    <>
    {
        spin ? <div className = "d-flex justify-content-center align-item-center">
            <Spinner animation="border" variant="danger" /> &n
        </div> : <div className="container">
        <h2 className="text-center mt-2">Projects</h2>
        <div className="card_div">
          <div className="row d-flex justify-content-around align-items-center">
            {projectData.map((el, index) => {
              return (
                <>
                  <Card
                    style={{ width: "22rem", height: "18rem" }}
                    className="mt-4 mb-4"
                  >
                    <Card.Img
                      variant="top"
                      style={{ width: "20rem", marginLeft: "-13" }}
                      src={el.imgsrc}
                    />
                    <Card.Body className = "d-flex justify-content-center flex-column">
                      <Card.Title className = "text-center">{el.projectName}</Card.Title>
                      <Card.Text></Card.Text>
                      <Button variant="primary">
                        <a
                          href={el.demo}
                          target="_blank"
                          rel="noopener noreferrer"
                          className="text-decoration-none text-white"
                        >
                          Live Demo
                        </a>
                      </Button>
                    </Card.Body>
                  </Card>
                </>
              );
            })}
          </div>
        </div>
      </div>
    }
    </>
  );
};

export default Playlist;
